import React from "react";
const catagories = ["Currently Reading", "Want to Read", "Read"];
function BookShelf() {
  return (
    <div>
      <div className="bookshelf">
        {catagories.map((item, index) => (
          <h2 key={index} className="bookshelf-title">
            {item}
          </h2>
        ))}
      </div>
    </div>
  );
}

export default BookShelf;
